import React from "react";
import './style.css';

const About = () => {
    return (
        <>
            <h1>About</h1>
            <h2>What is Neighborly?</h2>
            <p className="description">Neighborly is a platform where users can create neighborhood groups that will help connect them to the community. It is an easy way for all the neighbors in the group to know what events are going on, what people are in the neighborhood, etc.</p>
        </>
    );
};

export default About;
